- input: "TEXT\x1CC00484683\x1CT1\x1C\x1CF3A\x1C\"This amendment responds to the RFAI
    dated February 10, 2011. Additional information is provided by numbered item from
    the RFAI.  (1) Over the limit Donors-Both contributions (Crawford, John; Freeland,
    Deanna) identified resulted from inadvertently creating separate donor records
    for each contribution. That error has been remedied and the contributions have
    been redesignated for the Special Election rather than the General Election.  (2)
    Contributions received after Election Day, but designated for G2010. Upon review
    of the Committee's records, it appears that these contributions were reported
    with incorrect dates. Each of these contributions was received by an agent of
    the campaign on or before November 2, 2010. The dates have been updated in this
    report.  (3) The totals in column B have been corrected to refelect the election
    cycle-to-date totals. (4) 48-Hour Notice Discrepancies. You note discrepancies
    between 48-Hour Notices and the 30G Report. With respect to the American Dental
    Association PAC contribution on 10/22, the Committee inadvertently filed two 48-Hour
    Notices reporting this contribution; it is correctly reported as a single contribution
    on the 30G. With respect to the CONCRETE PAC $1,000 contribution on 10/29, the
    Committee correctly reported the contribution on the 48-Hour Notice, but inadvertently
    attributed the contribution to the American Concrete Pavement Association PAC
    rather than the CONCRETE PAC on the 30G. This report has been amended to correctly
    report CONCRETE PAC.  (5) Additional information regarding contributors' employers
    and occupations have been added to this amended report. A Form 99 has also been
    filed detailing the Committee's \"best efforts\"procedure.  (6) Itemized Disbursement
    Descriptions. The inadequate purpose description noted in the request (\"Time
    & Space\") has been clarified (\"TV Advertising Buy\").\"\n"
